import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='page-wrapper'>
        <nav class="navbar navbar-expand-lg navbar-dark primary-color">


<a class="navbar-brand" href="index.html">DB Electronics</a>

{/* Collapse button */}
<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#basicExampleNav" aria-controls="basicExampleNav" aria-expanded="false" aria-label="Toggle navigation">
<span class="navbar-toggler-icon"></span>
</button>

{/* <!-- Collapsible content --> */}
<div class="collapse navbar-collapse" id="basicExampleNav">

    {/* <!-- Links --> */}
    <ul class="navbar-nav mr-auto">
        <li class="nav-item">
            <a class="nav-link" href="./index.html">Home
<span class="sr-only">(current)</span>
</a>
        </li>
        <li class="nav-item active">
            <a class="nav-link" href="./products.html">Products</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="./contact.html">Contact Us!</a>
        </li>

        {/* <!-- Dropdown --> */}


    </ul>
    <ul class='navbar-nav sort'>
        <li class="nav-item dropdown float-right">
            <a href='#' class="nav-link dropdown-toggle" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Sort</a>
            <div class="dropdown-menu dropdown-primary" aria-labelledby="navbarDropdownMenuLink">
                <a class="dropdown-item" id='typeSortDropdown'>Sort by Type</a>
                <a class="dropdown-item" id='priceSortDropdown'>Sort by Price</a>
                <a class="dropdown-item" id='unsortDropdown'>Unsort</a>
            </div>
        </li>
    </ul>
    {/* <!-- Links --> */}
</div>
{/* <!-- Collapsible content --> */}

</nav>
    </div>
  );
}

export default App;
